// Import required modules from 'react' and 'react-router-dom'
import React from 'react';
import { Route, Routes, useNavigate } from 'react-router-dom';

// Import custom components
import Button from './Button';

// Page0 component
const HomeContent = () => {
  const navigate = useNavigate();

  // Function to handle button click and navigate to page1
  function handleClick(event) {
    navigate('/page0');
  }

  return (
    <div className="container" style = {{ alignment : "center"}}>
      <p>This is a sample text paragraph that can be edited later.</p>

      <Button
        text="Start Quiz"
        onClick={handleClick}
        style={{ padding: '10px 28px', marginTop: '20px' }}
      />
    </div>
  );
};

export default HomeContent;
